import { BrowserRouter as Router, Switch, Route, Redirect } from 'react-router-dom'
import './App.css';
import Login from './Components/UserForm/Login/Login'

function App() {
  return (
    <div className="App">
       <p>This is my webshop</p>
      <Router>

        <Switch>
          <Route exact path='/Login' component = {()=><Login/>}/>
        </Switch>
      </Router>

    </div>
  );
}

export default App;
